import styled from 'styled-components';
import style from '/.'

export const HeaderContainer = styled.header`
  background-color: #282c34;
  padding: 10px 20px;
  color: white;
  text-align: center;
  font-family: ;
`;

export const Nav = styled.nav`
  margin-top: 10px;
`;

export const NavLink = styled.a`
  color: white;
  margin-right: 15px;
  text-decoration: none;
  
  &:last-child {
    margin-right: 0;
  }

  &:hover {
    color: #61dafb;
  }
`;
